import axios from "axios";
import React, { useEffect, useState } from "react";
import { Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper, Box } from '@mui/material';
import { InputSelect } from "./InputSelect";
import { numberWithCommas } from '../NFTs/PriceTable';

const getData = () => {
    return axios(`https://market-api.radiocaca.com/nft-sales?pageSize=1600&sortBy=fixed_price&order=asc&category=13&tokenId=-1`, {
        "Access- Control - Allow - Origin": "*"
    });
}

const Metamon = () => {
    const [lowestPrice, setLowestPrice] = useState([]);
    const [highestScore, setHighestScore] = useState([]);
    const [highestLevel, setHighestLevel] = useState([]);

    const getListMetamon = async () => {
        await getData().then(res => {
            const data = res.data.list;
            const lowest = data.sort((pre, cur) => {
                if (pre.fixed_price < cur.fixed_price) {
                    return 1;
                }
                return 0;
            })
            lowest.length = 10;
            console.log(lowest);
            setLowestPrice(lowest);
        });
    }
    getListMetamon();
    return (
        <Box sx={{ textAlign: 'left' }}>
            <InputSelect />
            <TableContainer id='table-scroll' component={Paper}>
                <Table id='tablePrice' aria-label="simple table">
                    <TableHead>
                        <TableRow>
                            <TableCell align="center">#</TableCell>
                            <TableCell align="center">

                            </TableCell>
                            <TableCell align="center">
                                ID
                            </TableCell>
                            <TableCell align="center">
                                Score
                            </TableCell>
                            <TableCell align="center">
                                Level
                            </TableCell>
                            <TableCell align="center">
                                Price
                            </TableCell>
                        </TableRow>
                    </TableHead>
                    <TableBody>
                        {lowestPrice && lowestPrice.map((metamon, index) => (
                            <React.StrictMode>
                                <TableCell align="center" component="th" scope="row">{index + 1}</TableCell>
                                <TableCell align="center" component="th" scope="row"><img width='50px' height='50px' src='/marketplaceraca/metamon.png' alt='Metamon' /></TableCell>
                                <TableCell align="center" component="th" scope="row">
                                    #123456</TableCell>
                                <TableCell align="center" component="th" scope="row">320</TableCell>
                                <TableCell align="center" component="th" scope="row">20</TableCell>
                                <TableCell align="center" component="th" scope="row">{numberWithCommas(200000)}</TableCell>
                            </React.StrictMode>
                        ))}

                    </TableBody>
                </Table>
            </TableContainer>
        </Box>

    )
}

export default Metamon;
